import React, { useState } from 'react';
import { makeStyles, Theme } from '@material-ui/core/styles';
import ListSubheader from '@material-ui/core/ListSubheader';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemIcon from '@material-ui/core/ListItemIcon';
import ListItemText from '@material-ui/core/ListItemText';
import Collapse from '@material-ui/core/Collapse';
import ExpandLess from '@material-ui/icons/ExpandLess';
import ExpandMore from '@material-ui/icons/ExpandMore';

const useStyles = makeStyles((theme: Theme) => ({
  /*  root: {
    width: '100%',
    maxWidth: 360,
    backgroundColor: theme.palette.background.paper,
  }, */
  nested: {
    paddingLeft: theme.spacing(4),
  },
}));

const TypeBar: React.FC = () => {
  const classes = useStyles();
  const [open, setOpen] = useState(true);

  const handleClick = () => {
    setOpen(!open);
  };
  const brand = ['Samsung', 'Lenovo', 'Acer'];
  const device = ['Смартфоны', 'Планшеты', 'Ноутбуки'];
  return (
    <List
    // component="nav"
    // subheader={<ListSubheader component="div">Device List</ListSubheader>}
    >
      {device.map((element) => {
        return (
          <div>
            <ListItem button onClick={handleClick}>
              <ListItemText inset primary={element} />
              {open ? <ExpandLess /> : <ExpandMore />}
            </ListItem>
            <Collapse in={open} timeout="auto" unmountOnExit>
              <List component="div" disablePadding>
                {brand.map((e) => {
                  return (
                    <ListItem button className={classes.nested}>
                      <ListItemText inset primary={e} />
                    </ListItem>
                  );
                })}
              </List>
            </Collapse>
          </div>
        );
      })}
    </List>
  );
};

export default TypeBar;
